import React, { Component } from 'react';
import './App.css';
import Menu from "./component/menu/Menu";
import Products from "./component/products/Products";

class App extends Component {
  render() {
    return (
      <div className="App">
        {/* Menu */}
        <Menu />

        <div className="container">
          <div className="row">
            {/* Products */}
            <Products />

          </div>
        </div>
    </div>
    );
  }
}

export default App;
